import { Link } from "react-router-dom";

const Nabvar = () => {
    return (
        <div>
            <ul>
                <li><Link to="/"></Link></li>
                <li><Link to="/about">About</Link></li>
                <li><Link>Portfolio</Link></li>
                <li><Link>Resume</Link></li>
                <li><Link>Contact Me</Link></li>
            </ul>
        </div>
    )
}

export default Nabvar;
